import React from 'react';

import ImageGallery from 'react-image-gallery';

class photoCarousel extends React.Component {
    render() {
        let images = [{
            original: '../images/photography/beaufort.jpg',
            thumbnail: '../images/photography/beaufort.jpg',
        }, 
        {
            original: '../images/photography/Cake.jpg',
            thumbnail: '../images/photography/Cake.jpg',
        },
        {
            original: '../images/photography/Downtown-Bridge-yo.jpg',
            thumbnail: '../images/photography/Cake.jpg',
        },
    ]
    }
}
